Chart4_1.query:
q = load "${App.Datasets.ERR_Dataset_tp.FullyQualifiedName}";
q_A = filter q by 'FeedbackType' in ["EDIT", "POST"];
q_B = filter q by 'FeedbackType' in ["NOT_HELPFUL", "PREDICTED"];

-- ## Weekly ## --
q_weekly = group q_A by ('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Week_First_Date_Day') full, q_B by ('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Week_First_Date_Day');
q_weekly = foreach q_weekly generate coalesce(q_A.'CreatedDate_Year' + "~~~" + q_A.'CreatedDate_Month' + "~~~" + q_A.'CreatedDate_Week_First_Date_Day', q_B.'CreatedDate_Year' + "~~~" + q_B.'CreatedDate_Month' + "~~~" + q_B.'CreatedDate_Week_First_Date_Day') as 'CreatedDate_Year~~~CreatedDate_Month~~~CreatedDate_Day', avg(q_A.'ActiveTime')/60 as 'With Interactions', avg(q_B.'ActiveTime')/60 as 'Without Interactions'
,"Weekly" as 'Timeframe';
q_weekly = order q_weekly by ('CreatedDate_Year~~~CreatedDate_Month~~~CreatedDate_Day' asc);

-- ## Monthly ## --
q_Monthly = group q_A by ('CreatedDate_Year', 'CreatedDate_Month') full, q_B by ('CreatedDate_Year', 'CreatedDate_Month');
q_Monthly = foreach q_Monthly generate coalesce(q_A.'CreatedDate_Year' + "~~~" + q_A.'CreatedDate_Month' + "~~~01" , q_B.'CreatedDate_Year' + "~~~" + q_B.'CreatedDate_Month' + "~~~01" ) as 'CreatedDate_Year~~~CreatedDate_Month~~~CreatedDate_Day', avg(q_A.'ActiveTime')/60 as 'With Interactions', avg(q_B.'ActiveTime')/60 as 'Without Interactions'
,"Monthly" as 'Timeframe';
q_Monthly = order q_Monthly by ('CreatedDate_Year~~~CreatedDate_Month~~~CreatedDate_Day' asc);


-- ## Quarterly ## --

q_Quarterly = group q_A by ('CreatedDate_Year', 'CreatedDate_Quarter_First_Date_Month', 'CreatedDate_Quarter') full, q_B by ('CreatedDate_Year','CreatedDate_Quarter_First_Date_Month','CreatedDate_Quarter');
q_Quarterly = foreach q_Quarterly generate coalesce(q_A.'CreatedDate_Year' + "~~~" + q_A.'CreatedDate_Quarter_First_Date_Month' + "~~~01" , q_B.'CreatedDate_Year' + "~~~" + q_B.'CreatedDate_Quarter_First_Date_Month' + "~~~01" ) as 'CreatedDate_Year~~~CreatedDate_Month~~~CreatedDate_Day', avg(q_A.'ActiveTime')/60 as 'With Interactions', avg(q_B.'ActiveTime')/60 as 'Without Interactions'
,"Quarterly" as 'Timeframe';
q_Quarterly = order q_Quarterly by ('CreatedDate_Year~~~CreatedDate_Month~~~CreatedDate_Day' asc);

result = union q_weekly, q_Monthly,q_Quarterly;

result = filter result by {{column(TimeframeSelector_2.selection, ["Timeframe"]).asEquality("Timeframe")}};

