all_10.query:
q = load "${App.Datasets.ERR_Dataset_tp.FullyQualifiedName}";
q_A = filter q by 'FeedbackType' == "EDIT";
q_B = filter q by 'FeedbackType' == "POST";
q_C = filter q by 'FeedbackType' == "NOT_HELPFUL";
result = group q by ('ResponseId', 'QT.Message') full, q_A by ('ResponseId', 'QT.Message') full, q_B by ('ResponseId', 'QT.Message') full, q_C by ('ResponseId', 'QT.Message');
result = foreach result generate coalesce(q_A.'ResponseId', q_B.'ResponseId', q_C.'ResponseId', q.'ResponseId') as 'ResponseId', coalesce(q_A.'QT.Message', q_B.'QT.Message', q_C.'QT.Message', q.'QT.Message') as 'QT.Message', count(q_A) as 'EditCount', count(q_B) as 'PostCount', count(q_C) as 'NotHelpfulcount', count(q) as 'RecommendedCount', unique(q.'ConversationId') as 'UniqueChats';
result = foreach result generate 'ResponseId' as 'QuickText ID', 'QT.Message' as 'Reply Text', 'EditCount' as  'Edit', 'PostCount' as  'Post', 'NotHelpfulcount' as 'Not Helpful', 'RecommendedCount' as 'Recommended', 'UniqueChats' as 'Chats', (EditCount + PostCount) / RecommendedCount as 'Interaction Rate';
result = order result by ('QuickText ID' asc, 'Reply Text' asc);
result = limit result 2000;

